function initializeOSMap() {

    var bounds = new L.LatLngBounds(new L.LatLng(48.438, 1.4023), new L.LatLng(49.2614, 3.3258));
    var osm = L.tileLayer('https://{s}.tile.osm.parisinfo.com/osm_tiles/{z}/{x}/{y}.png', {
        attribution: 'Â© les contributeurs <a href="http://www.openstreetmap.org/copyright" target="_blank">OpenStreetMap</a>'
    });

    map = L.map('googleMapDisplayed', {
        center: bounds.getCenter(),
        layers: [osm],
        attributionControl: false
    });
    L.control.attribution({prefix: '<a href="http://leafletjs.com" target="_blank" title="A JS library for interactive maps">Leaflet</a>'}).addTo(map);
    map.setView(bounds.getCenter(), 12);
    map.setMaxBounds(bounds);
    //map.fitBounds(bounds);

    return map;
}

