function routingControl(map, waypoints, markers_popup, isPopup) {
    var routeControl1 = L.Routing.control({
        waypoints: waypoints,
        createMarker: function (waypointIndex, waypoint, numberOfWaypoints) {

            var iconPath = '/bundles/otcpotcp/images/map/';
            if(theme == 'pros'){
                iconPath+='pro/';
            }

            var myIcon = L.icon({
                iconUrl: iconPath+'picto-gmap-' + (waypointIndex + 1) + '.png',
                iconSize: [32, 38],
                iconAnchor: [16, 38],
                popupAnchor: [0, -36]
            });
            var marker = L.marker(waypoint.latLng, {icon: myIcon}).addTo(map);
            if (isPopup) {
                var content = '<div style="width:360px;"><h2>' + markers_popup[waypointIndex].title + '</h2>';
                var address = markers_popup[waypointIndex].addr;
                content += markers_popup[waypointIndex].img;
                content += '<p style="margin-left:149px;">' + address + '</br>';
                content += '<br />' + markers_popup[waypointIndex].link + '</p><br style="clear:both" /></div>';
                var popup = L.popup({
                    maxWidth: 400
                }).setContent(content);
                marker.bindPopup(popup);
                13
            }
            return marker;
        },
        lineOptions: {
            styles: [
                {color: '#00ACE5', opacity: 1, weight: 4}
            ],
            addWaypoints: false
        },
        routeWhileDragging: false,
        autoRoute: false
    });
    routeControl1.route();
    routeControl1.addTo(map);
    routeControl1.hide();

    $('.leaflet-routing-container.leaflet-bar.leaflet-control.leaflet-routing-container-hide').remove();

}


function displayMarkers(mapPoints,markers_popup){

    var iconPath = '/bundles/otcpotcp/images/map/';

    console.log(theme);

    if(theme == 'pros'){
        iconPath+='pro/';
    }

    for(var i=0; i<mapPoints.length;i++){

        if(mapPoints.length > 1)
        {
            var myIcon = L.icon({
                iconUrl: iconPath+'picto-gmap-' + (i + 1) + '.png',
                iconSize: [32, 38],
                iconAnchor: [16, 38],
                popupAnchor: [0, -36]
            });
        } else {
            var myIcon = L.icon({
                iconUrl: iconPath+'marker.png',
                iconSize: [32, 38],
                iconAnchor: [16, 38],
                popupAnchor: [0, -36]
            });
        }


        var latLng = mapPoints[i];
        var marker = L.marker(latLng, {icon: myIcon}).addTo(map);

        var content = '<div style="width:360px;"><h2>' + markers_popup[i].title + '</h2>';
        var address = markers_popup[i].addr;
        content += markers_popup[i].img;
        content += '<p style="margin-left:149px;">' + address + '</br>';
        content += '<br />' + markers_popup[i].link + '</p><br style="clear:both" /></div>';
        var popup = L.popup({
            maxWidth: 400
        }).setContent(content);
        marker.bindPopup(popup);

    }

}




