function initializeOSMPointResult() {
    if (!scriptIsLoad) {
        setTimeout("initializeOSMap()", 1000);
        scriptIsLoad = true;
    }
    setTimeout("loadOSMResult()", 1400);
}

function initializeOSMPointAccess() {
    if (!scriptIsLoad) {
        setTimeout("initializeOSMap()", 1000);
        scriptIsLoad = true;
    }
    setTimeout("loadGmap()", 1000);
}

function addPointByCoordOSM(latlon, title, compteur) {
    var myIcon = L.icon({
        iconUrl: '/bundles/otcpstatic/images/map/picto-gmap-' + (waypointIndex + 1) + '.png',
        iconSize: [32, 38],
        iconAnchor: [16, 38],
        popupAnchor: [0, -36]
    });
    var marker = L.marker(latlon, {
        icon: myIcon,
        title: title
    }).addTo(map);
}

function setCenterOnAllMarkersOSM(markers) {
    var bounds = new L.LatLngBounds();
    console.log(markers);
    for (id in markers) {
        bounds.extend(markers[id]);
    }
    map.fitBounds(bounds);
}

function addPointByAdressOSM(address, title) {
    var params = {q: address};
    var url = "http://api-adresse.data.gouv.fr/search" + L.Util.getParamString(params);
    $.getJSON(url, function (data, status, xhr) {
        if (status == 'success' && data.features && data.features.length > 0) {
            var geometry = data.features[0].geometry;
            var LatLng = L.latLng(parseFloat(geometry.coordinates[1]), parseFloat(geometry.coordinates[0]));
            addPointByCoordOSM(LatLng, title, 1);
            map.panTo(LatLng);
            setTimeout(function () {
                map.setZoomAround(LatLng, 17);
            }, 405);
        } else {
            params = {q: address, format: 'json'};
            url = "http://nominatim.openstreetmap.org/search" + L.Util.getParamString(params);
            $.getJSON(url, function (data, status, xhr) {
                if (status == 'success' && data.length > 0) {
                    var LatLng = L.latLng(parseFloat(data[0].lat), parseFloat(data[0].lon));
                    addPointByCoordOSM(LatLng, title, 1);
                    map.panTo(LatLng);
                    setTimeout(function () {
                        map.setZoomAround(LatLng, 17);
                    }, 405);
                }
            });
        }
    });
}
